import React from "react";
import Header from "./components/Header";
import Card from "./components/Card";
import data from "./data";

export default function App(){

 cards = data.map(item=>{

        return(
            <Card

                key={item.id} 
                item={item}
            />
        )
    })
    return (
        <div className="container">
            
        <Header />
        <section className="card--list">
            {cards}
        </section>
        </div>
    )
}
